import phonenumbersfrom bot import loggerdef getNumberCodeForProxy(phoneCode: int):    # CA    if phoneCode in [998, 7, 993, 992, 1]:        phoneCode = 7    # Egypt    if phoneCode in [213, 249, 258, 62, 90, 98]:        phoneCode = 20    # India    if phoneCode in [66, 63, 880, 93, 95]:        phoneCode = 91    # Nigeria    if phoneCode in [225, 234, 233, 251, 256, 265, 27, 996]:        phoneCode = 234    return phoneCodedef getPhoneNumberCode(phoneNumber: str):    try:        phone_number = phonenumbers.parse(phoneNumber)        country_code = phone_number.country_code    except (phonenumbers.NumberParseException, Exception) as e:        logger.error(f"Phone number exc - {e}")        return 7    return getNumberCodeForProxy(country_code)